method.doc:
Returns the value of this {@link Quantity}.
In {@link Compartment}s the value is its size, in {@link Species} the value defines its initial amount or concentration, and in {@link Parameter}s and {@link LocalParameter}s this returns the value attribute from SBML.
@return the value

Sets the value of this {@link Quantity}.
Note that the meaning of the value can be different in all derived classes. In {@link Compartment}s the value defines its size. In {@link Species} the value describes either the initial amount or the initial concentration. Only the class {@link Parameter} and {@link LocalParameter} really define a value attribute with this name.
@param value the value to set

